import { RouterItem } from "@/router/types"
import Menu from "@/pages/content/pages/menu"
import Role from '@/pages/content/pages/role'
const routers: RouterItem[] = [
  {
    path: "/role",
    component: Role,
  },
  {
    path: "/menu",
    component: Menu,
  }
]

export default routers
